import React, { useState } from 'react';
import coverImage from '../assets/cover_image.jpg';

const LoginPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement your login logic here, e.g., API call, local storage, etc.
    console.log('Username:', username);
    console.log('Password:', password);
  };

  return (
    <div className="h-screen bg-cover bg-center bg-no-repeat" style={{ backgroundImage: `url(${coverImage})` }}>
      <div className="flex h-full items-center justify-center">
        <div className="w-full max-w-md p-4 bg-white rounded-lg shadow-md">
          <h1 className="text-3xl font-bold text-center mb-4 text-white">Coquette Theme</h1>
          <p className="text-lg text-center mb-6 text-white">Get your pink!</p>
          <form onSubmit={handleSubmit} className="space-y-4">
            <div className="relative">
              <input type="text" id="username" name="username" value={username} onChange={(e) => setUsername(e.target.value)} className="block w-full px-3 py-2 border rounded-md focus:outline-none focus:ring-blue-500 focus:border-blue-500" placeholder="Username" />
            </div>
            <div className="relative">
              <input type="password" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} className="block w-full px-3 py-2 border rounded-md focus:outline-none focus:ring-blue-500 focus:border-blue-500" placeholder="Password" />
            </div>
            <button type="submit" className="w-full px-4 py-2 text-white bg-blue-500 rounded-md hover:bg-blue-600">Login</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
